import React,{ useState} from "react";
import {Dialog,DialogTitle,DialogContentText,DialogContent,
  TextField,DialogActions,Button,FormControl,Select , MenuItem} from "@material-ui/core";

const ModalBranch = (props)=>{
const { isOpen, handleClose  } = props;
const [ branch, setBranch] = useState({
  Id : 0,
  Name: '',
  LineId : 0
});

const saveBranchLocal = (e) =>{
  const { name , value} = e.target;

  setBranch((last) => ({
     ...last,
     [name] : value
  }));
}

    return(
        <Dialog open={isOpen} onClose={handleClose} aria-labelledby="form-dialog-title">
             <DialogTitle id="form-dialog-title">Marca</DialogTitle>
        <DialogContent>

           <FormControl fullWidth variant="outlined"  > 
                    <Select 
                        fullWidth
                        label="Linea"
                        name="LineId"
                        value={branch.LineId || '0'}
                        onChange={saveBranchLocal}
                        >
                        <MenuItem value="0">
                            <em>Seleccione</em>
                        </MenuItem>
                        <MenuItem value={1}>EQUIPAMIENTO</MenuItem>
                        <MenuItem value={2}>HEMATOLOGÍA</MenuItem>
                        <MenuItem value={3}>BIOQUÍMICA</MenuItem>
                        <MenuItem value={4}>INMUNOLOGÍA</MenuItem> 
                        </Select>

                    </FormControl>


          <TextField
            autoFocus
            margin="dense"
            label="Descripción"
            type="text"
            name="Name"
            value={branch.Name || ''}
            onChange={saveBranchLocal}
            fullWidth
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Salir
          </Button>
          <Button onClick={handleClose} color="primary">
            Guardar
          </Button>
        </DialogActions>
        </Dialog>
    )
}
export default ModalBranch;
